import { Nav, Container, Row, Col } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';


function Link({to, children}) {
  return (
    <Nav.Item>
      <NavLink to={to} exact className="nav-link"
               activeClassName="active">
        {children}
      </NavLink>
    </Nav.Item>
  );
}
export default function AppNav() {
  return(
    <div className="">
      <Row>
        <Col>
          <Nav>
            <h1 className="mr-5 display-1 font-weight-bold text-light">HWZone</h1>
          </Nav>
        </Col>
      </Row>
      <Row>
      <Nav variant="pills">
        <Link to="/">Wellness</Link>
        <Link to="/lostfound">Lost/Found</Link>
        <Link to="/food">Food Choices</Link>
        <Link to="/selladopt">Sell/Adopt</Link>
        <Link to="/forum">Forum</Link>
      </Nav>
      </Row>
    </div>
  );
}
